import './App.css';
import Header from './components/header/header';
import Navbar from './components/navbar/navbar';
import { BrowserRouter, Route } from 'react-router-dom';
import Profile from './components/content/Profile/Profile';
import Posts from './components/content/MyPosts/Posts';
import Dialogs from './components/content/dialogs/Dialogs';


function App(props) {

  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <div className="blockContent">

          {/* <Route path='/profile' component={Profile} /> */}
          {/* <Route path='/posts' component={Posts} />
          <Route exact path='/messages' component={Dialogs} /> */}

          <Route path='/profile' render = {() => <Profile />}/>
          <Route path='/posts' render = {() => <Posts postsData = {props.state.postsData} addPost = {props.addPost} changeNewText = {props.changeNewText}/> } />
          <Route exact path='/messages' render = {() => <Dialogs messagesData = {props.state.messagesData} dialogsData = {props.state.dialogsData} />} />
        </div>
        <Navbar />


      </div>
    </BrowserRouter>

  );
}

export default App;
